.qm-clock .qm-hand {

  top: 50%;
  left: 50%;
  transform-origin: 0 50%;
  border-radius: 2px;

}
.qm-clock .qm-hour {

}
.qm-clock .qm-minute {

  height: 3px;

}
.qm-clock .qm-second {
  width: calc(var(--qm-size) * 0.40);
  height: 2px;
  background: var(--qm-accent);
  box-shadow: 0 0 8px rgba(139,185,255,.55);
}
.qm-clock .qm-pin {

  width: 12px;
  height: 12px;

}
.qm-clock .qm-digital {

  color: var(--qm-muted);
}
@media (prefers-reduced-motion: reduce) {
  .qm-clock .qm-hand { transition: none !important; }
}

  function initClock(el) {
    const size = parseInt(el.dataset.size || "240", 10);
    const tz = el.dataset.timezone || Intl.DateTimeFormat().resolvedOptions().timeZone || "UTC";
    const labelText = el.dataset.title || tz.replace(/_/g, ' ');
    const showSeconds = (el.dataset.seconds || "true") !== "false";
    const is24h = (el.dataset["24h"] || el.dataset.is24h || "false") === "true";
    const logoOpacity = parseFloat(el.dataset.logoOpacity || "0.14");

    el.style.setProperty('--qm-size', size + 'px');
    el.style.setProperty('--qm-logo-opacity', String(logoOpacity));
    el.classList.add('qm-clock');

    el.innerHTML = `
      <div class="qm-face" aria-hidden="true">
        <img class="qm-logo" src="${LOGO_DATA_URL}" alt="QuantML logo" />
        <div class="qm-ticks" role="presentation"></div>
        <div class="qm-hand qm-hour" aria-hidden="true"></div>
        <div class="qm-hand qm-minute" aria-hidden="true"></div>
        <div class="qm-hand qm-second" style="${showSeconds ? '' : 'display:none'}" aria-hidden="true"></div>
        <div class="qm-pin" aria-hidden="true"></div>
      </div>
      <div class="qm-digital" aria-live="polite">
        <div class="qm-time"></div>
        <div class="qm-date"></div>
        <div class="qm-label">${labelText}</div>
      </div>
    `;

    // Build ticks
    const ticks = el.querySelector('.qm-ticks');
    for (let i = 0; i < 60; i++) {
      const t = document.createElement('span');
      t.className = 'qm-tick' + (i % 5 === 0 ? ' major' : '');
      const r = Math.round(size * 0.40); // radius for ticks
      t.style.transform = `rotate(${i * 6}deg) translate(${r}px)`;
      ticks.appendChild(t);
    }

    // Prepare formatters
    const timeFmt = new Intl.DateTimeFormat([], {
      timeZone: tz,
      hour: '2-digit',
      minute: '2-digit',
      second: showSeconds ? '2-digit' : undefined,
      hour12: !is24h
    });

    const partsFmt = new Intl.DateTimeFormat([], {
      timeZone: tz,
      hour: 'numeric',
      minute: 'numeric',
      second: 'numeric',
      hour12: false
    });

    const dateFmt = new Intl.DateTimeFormat([], {
      timeZone: tz,
      weekday: 'short', year: 'numeric', month: 'short', day: '2-digit'
    });

    const elHour = el.querySelector('.qm-hour');
    const elMinute = el.querySelector('.qm-minute');
    const elSecond = el.querySelector('.qm-second');
    const elTime = el.querySelector('.qm-time');
    const elDate = el.querySelector('.qm-date');

    function hms(date) {
      const p = partsFmt.formatToParts(date);
      let h=0,m=0,s=0;
      for (const x of p) {
        if (x.type === 'hour') h = parseInt(x.value, 10);
        else if (x.type === 'minute') m = parseInt(x.value, 10);
        else if (x.type === 'second') s = parseInt(x.value, 10);
      }
      return {h,m,s};
    }

    function tick() {
      const now = new Date();
      const {h,m,s} = hms(now);
      const hourAngle = ((h % 12) + m/60 + s/3600) * 30; // 360/12
      const minuteAngle = (m + s/60) * 6;                // 360/60
      const secondAngle = s * 6;

      elHour.style.transform = `rotate(${hourAngle}deg)`;
      elMinute.style.transform = `rotate(${minuteAngle}deg)`;
      if (showSeconds) elSecond.style.transform = `rotate(${secondAngle}deg)`;

      elTime.textContent = timeFmt.format(now);
      elDate.textContent = dateFmt.format(now);

      const ms = now.getMilliseconds();
      setTimeout(tick, showSeconds ? (1000 - ms + 10) : (1000 - ms + 10));
    }

    tick();
  }

  function boot() {
    document.querySelectorAll('.qm-clock').forEach(initClock);
  }

  if (document.readyState === 'loading') document.addEventListener('DOMContentLoaded', boot);
  else boot();
})();

  </script>
